                },
                {
                    street: 'Brewery',
                    x: 14.25,
                    y: 29.3,
                    rotate: 65,
                }
            ]).enter()
            .append('text')
            .attr("x", (d) => xScale(d.x))
            .attr("y", (d) => yScale(d.y))
            .attr("dy", ".35em")
            .style("transform", (d) => `rotate(${d.rotate}deg)`)
            .style("font-size", (d) => d.fontSize || 10)
            .text((d) => d.street);

        //pumps
        pumps = d3Ref.current.selectAll('circle')
            .data(props.pumps)
            .enter()
            .append('circle')
            .style("fill", "deepskyblue")
            .style("r", 8)
            .style("z-index", 2)
            .attr("cx", (d:any) => xScale(d.x))
            .attr("cy", (d:any) => yScale(d.y)) as any;

        deaths = d3Ref.current.selectAll('text')
            .data(props.deaths)
            .enter()
            .append("circle")
            .style("fill", "red")
            .style("r", 4)
            .attr("cx", (d:any) => xScale(d.x))
            .attr("cy", (d:any) => yScale(d.y))
            .attr("class", 'death')
            .style("z-index", 1)
            .style("cursor", "pointer")
            .on("mouseover", mouseOver)
            .on("mousemove", mouseMove)
            .on("mouseleave", mouseOut) as any
    }

    useEffect(() => {
        if (streets && pumps && deaths) {
            streets.attr("points", (d:any) => {
                let points = "";
                d.forEach((_:any, i: number) => points += `${xScale(d[i].x)}, ${yScale(d[i].y)} `);
                return points;
            });
            deaths.attr("cx", (d:any) => xScale(d.x))
            .attr("cy", (d:any) => yScale(d.y))
            pumps.attr("cx", (d:any) => xScale(d.x))
            .attr("cy", (d:any) => yScale(d.y))
        }
    },[windowSize.width]);

    useEffect(() => {
        try {
            tooltip = d3.select("#tooltip")
            .append("div")
            .style("position", "absolute")
            .style("visibility", "hidden")
            .style("padding", "10px")
            .style("border-radius", "5px")
            .style("zIndex", 100)
            .style("background", "gray")
            .style("color", "white")
            .style("height", "70px")
            .style("width", "150px")
            .text("");

            const ds = d3Ref.current.selectAll('.death')
            ds.remove();
            deaths = d3Ref.current.selectAll('text')
                .data(props.deaths)
                .enter()
                .append("circle")
                .style("fill", "red")
                .style("r", 4)
                .attr("cx", (d:any) => xScale(d.x))
                .attr("cy", (d:any) => yScale(d.y))
                .attr("class", 'death')
                .style("z-index", 1)
                .style("cursor", "pointer")
                .on("mouseover", mouseOver)
                .on("mousemove", mouseMove)
                .on("mouseleave", mouseOut) as any
        } catch (e) {
            console.log(e);
        }
    },[props.deaths])

    return <>
        <div style={{ position: 'absolute', zIndex: 2 }}>
            <div id="tooltip"></div>
        </div>
        <div
            id="paper-plane"
            style={{
                // p: 2,
                display: 'flex',
                flexDirection: 'column',
                height: width,
                position: 'relative',
                zIndex: 1,
                overflow: "hidden",
            }}
        >
            <svg height="100%" style={{cursor: 'move'}}>
                <g height="100%">
                </g>
            </svg>
        </div>
    </>;
}

